import React from "react";

import ItemContainer from "./itemcontainer.js";

function List({ setCurrentScreen }) {
  return (
    <div className="list-container">
      <div className="list-header">
        <h1>Notebooks</h1>
      </div>
      <ItemContainer />
      <ItemContainer />
      <ItemContainer />
    </div>
  );
}

export default List;
